Info:
----------
Boardwalk Empire is an American period drama series from premium cable channel HBO, set in Atlantic City, New Jersey, during the Prohibition era. It stars Steve Buscemi as Nucky Thompson. Primetime Emmy Award-winning screenwriter and producer Terence Winter created the show inspired by the book Boardwalk Empire: The Birth, High Times, and Corruption of Atlantic City by Nelson Johnson about historical criminal kingpin Enoch L. Johnson.


The fourth season of the HBO television series Boardwalk Empire premiered on September 8, 2013, and concluded on November 24, 2013, consisting of 12 episodes. The series was created by Terence Winter and based on the book Boardwalk Empire: The Birth, High Times and Corruption of Atlantic City by Nelson Johnson. Set in Atlantic City, New Jersey, during the Prohibition era, the series stars Steve Buscemi as Enoch &quot;Nucky&quot; Thompson (based on the historical Enoch L. Johnson), a political figure who rose to prominence and controlled Atlantic City, New Jersey, during the Prohibition period of the 1920s and early 1930s. The fourth takes place in 1924.




